import e2vdom

def on_compile(application, object, action_name, context, objects):
	result=objects
	for xobject in object.get_objects_list():
		result.append({"object": xobject})
	return result

class VDOM_dialog_2(VDOM_object):

	def render(self, parent, contents=""):

		id = 'o_' + (self.id).replace('-', '_')

		e2vdom.process(self, parent)

		result = """<style type="text/css">
%(css)s
</style>""" % {"css": self.style}


		if self.draggable == "0":
			draggable = "true"
		else: draggable = "false"

		if self.show == "1":
			show = "true"
		else: show = "false"

		if self.modal == "0":
			modal = "true"
		else: modal = "false"

		result += "<table style='display: none'cellspacing='0' cellpadding='0' border='0' class='boxy-wrapper'><tr><td class='top-left'></td><td class='top'></td><td class='top-right'></td></tr><tr><td class='left'></td><td class='boxy-inner'><div id='%s'; style='position: relative; width: %spx; height: %spx; z-index: %s'>%s</div></td><td class='right'></td></tr><tr><td class='bottom-left'></td><td class='bottom'></td><td class='bottom-right'></td></tr></table>\n\n" % (id, self.width, self.height, self.zindex, contents)

		result += """<script type='text/javascript'>
jQuery(document).ready(function($){
	d_id_%(id)s = '%(id)s';
	dialog_win_%(id)s=new Boxy($('#%(id)s'),{
		width: %(width)s
		,height: %(height)s
		,draggable: %(drag)s
		,title: '%(title)s'
		,closeText: ''
		,show: %(show)s
		,modal: %(modal)s
		,hideShrink: false
		,afterHide: function(){
			$('object[classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000"],object[type=application/x-shockwave-flash],embed[src$="swf"]').show();
			execEventBinded(d_id_%(id)s.substring(2, d_id_%(id)s.length), "onHide", {});
		}
		,afterShow: function(){execEventBinded(d_id_%(id)s.substring(2, d_id_%(id)s.length), "onShow", {});}
	});
	if(typeof pngfix=='function'){
		$('.boxy-wrapper').find('.top,.left,.right,.bottom,.top-right,.top-left,.bottom-left, .bottom-right').pngfix({sizingMethod:'scale'});
	}
});
</script>""" % {"id": id, "width": self.width, "height": self.height, "drag": draggable, "title": self.title, "show": show, "modal": modal}

		return VDOM_object.render(self, parent, contents=result)

	def wysiwyg(self, parent, contents=""):

		result= "<container id=\"%s\" zindex=\"%s\" hierarchy=\"%s\" order=\"%s\" top=\"%s\" left=\"%s\" width=\"%s\" height=\"%s\">"\
					"<svg>"\
						"<rect x=\"%s\" y=\"%s\" width=\"%s\" height=\"%s\" stroke=\"#cccccc\" stroke-width=\"3\" fill=\"#ffffff\">"\
							"<rect x=\"%s\" y=\"%s\" width=\"%s\" height=\"40\" fill=\"#e9e9e9\"/>"\
						"</rect>"\
					"</svg>"\
					"<text top=\"10\" width=\"%s\" fontsize=\"14\" color=\"black\" textalign=\"center\">%s</text>"\
				"%s</container>"%(
					self.id, self.zindex, self.hierarchy, self.order, self.top, self.left, int(self.width) + 3, int(self.height) + 3,
					0, 0, self.width, self.height,
					0, 0, self.width,
					self.width, self.title,
					contents)

		return VDOM_object.wysiwyg(self, parent, contents=result)

def set_attr(app_id, object_id, param):

	o = application.objects.search(object_id)


	css_square = """.boxy-wrapper { position: absolute; }
.boxy-wrapper.fixed { position: fixed; }
.boxy-modal-blackout { position: absolute; background-color: black; left: 0; top: 0; }

.boxy-wrapper .title-bar {
position: relative;
background-color: #e9e9e9;
padding:1px;
font-size:10px;
text-align:center;
}
.boxy-wrapper .title-bar a.close{
position: absolute;
background: url("/3938bd92-e009-2767-09e2-1da56035c24a.png") -95px -128px;
height: 18px;
width: 19px;
top: 6px;
right: 6px;
}
.boxy-wrapper .title-bar a.close:hover{
border: 1px inset #999999;
}
.boxy-inner {
background-color:#fff !important;
border:3px solid #ccc;
}"""
	css_rounded = """.boxy-wrapper { position: absolute; }
.boxy-wrapper.fixed { position: fixed; }
.boxy-modal-blackout { position: absolute; background-color: black; left: 0; top: 0; }

.boxy-wrapper .title-bar {
background-color: #e9e9e9;
padding:1px;
font-size:10px;
text-align:center;
}

.boxy-wrapper .title-bar a.close{
position: absolute;
background: url("/3938bd92-e009-2767-09e2-1da56035c24a.png") -95px -128px;
height: 18px;
width: 19px;
top: 6px;
right: 6px;
}
.boxy-wrapper .title-bar a.close:hover{
border: 1px inset #999999;
}

.boxy-inner {
background-color:#fff !important;
border:3px solid #ccc;
border-radius:6px;
-moz-border-radius:6px;
-webkit-border-radius:6px;
}
	"""
	# set attributes
	if "skin" in param:
		if param["skin"]["value"] == "1":
			o.set_attributes({"style": css_square})
		elif param["skin"]["value"] == "2":
			o.set_attributes({"style": css_rounded})
	if "style" in param and param["style"]["value"] != css_square and param["style"]["value"] != css_rounded:		
		o.set_attributes({"skin": 0}) 	

	return ""
